import "./App.css";
import Create from "./components/create";
import { BrowserRouter as Router, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <div className="main">
        <h2 className="main-header">Users registration Form</h2>
        <div>
          <Route exact path="/Create"/ >
            {Create}

        </div>
      </div>
    </Router>
  );
}

export default App;
